A plugin can dynamically add ActionFilter to action methods, also to existing methods of the main program or other plugins. For
this purpose, an implementation of the abstract class ActionFilterRegistrar must be written, which must also be identified with the
attribute [ActionFilterRegistrar]. The abstract methods RegisterActionFilters and GetActionFilterType are to be implemented,
whereby GetActionFilterType must return the concrete type of the ActionFilter to be registered.
Example
[ActionFilterRegistrar]
public class TaskListActionFilterRegistrar : ActionFilterRegistrar
{
    public override IEnumerable<IActionFilterCriteria> RegisterActionFilters()
    {
        var taskListActionFilterCriteria = new ControllerActionCriteria();
        taskListActionFilterCriteria
            .AddMethod<ServiceOrderController>(c => c.Details(null));
        taskListActionFilterCriteria
            .AddMethod<ServiceCaseController>(t => t.Details(default(int)));
        return taskListActionFilterCriteria.AsEnumerable();
    }
    public override Type GetActionFilterType()
    {
        return typeof(TaskListActionFilter);
    }
}
6.5
Prevent deletion of lookups
There are cases in which an entry in a lookup table must not be deleted because the lookup value is being used by another
entity. Examples are the project status or the project category. If you were to delete a project status or a project category that is
used by a project, an exception would occur if an attempt is made to access the lookup property of the project instance.
To prevent used lookups from being deleted, a derivation of the base class UsedLookupsProviderBase must be implemented and
given the attribute [UsedLookupsProvider]. The class implements the abstract method GetUsedLookupKeys, which must return a
list of the lookup keys used, which must not be deleted.
Example
[UsedLookupsProvider]
public class ServiceUsedLookupsProvider : UsedLookupsProviderBase
{
    public override IEnumerable<object> GetUsedLookupKeys(Type lookupType)
    {
        if (lookupType == typeof(Skill))
        {
            return GetInstance<IServiceOrderService>().GetUsedSkills();
        }
        return new List<string>();
    }
}
The extension method ILookup.IsUsed can then be used in the code to check whether a specific lookup instance can be deleted
or not.
Example
[HttpPost]
public virtual ActionResult DeleteLookup(ILookup lookup)
{
    if (lookup.IsUsed())
    {
        return Json(new { errorMessage = "LookupDeletionDenied".GetTranslation() });
    }
    …
}
6.6
Events

With the help of events it is possible for a plugin to expand the functionality of the basic program. The extension is only possible
at predefined points in which the main program (or another plugin) publishes an event.
The event is an instance of a class derived from CrmEvent with any properties that are evaluated by an event handler to be
written by the user
