[ConcreteType(typeof(IProjectService))]
public class ProjectService: IProjectService
{
    [EventHandler(typeof(CompanyDeletedEvent), typeof(IProjectService))]
    public void OnCompanyDeleted(CompanyDeletedEvent e)
    {
        var projectsToDelete = from p in projectRepository.GetAll()
                                where p.Parent != null 
                                && e.CompanyIds.Contains(p.Parent.Id)
                                select p;
        foreach (var project in projectsToDelete)
        {
            projectRepository.Delete(project);
        }
    }
    ...
}
In the example, when a company is deleted in the EventHandler, which can be located in a project plug-in, for example, all
projects associated with the company are deleted.
The EventHandler must be located within a class registered with the IoC container. In the example, the class ProjectService is
registered as a specific type of the IProjectService interface.
The EventHandler attribute expects the type of event to be processed as the first parameter and the type of the interface under
which the class was registered with the IoC container as the second parameter.
Note: An EventHandler for a specific CrmEvent class also receives all events derived from it.
Example
The OnCrmEvent method of the NoteService class receives all events and checks for each received event whether there is an
associated implementation of the NoteGenerator class. If such a NoteGenerator exists, it creates a note about the event (see
section NoteGenerator).

[ConcreteType(typeof(INoteService))]
public class NoteService : INoteService
{
    [EventHandler(typeof(CrmEvent), typeof(INoteService))]
    public void OnCrmEvent(CrmEvent e)
    {
        var noteGenerators = Exports.Container.GetNoteGenerators();
        foreach (INoteGenerator noteGenerator in noteGenerators)
        {
            if (noteGenerator.EventType != e.GetType())
            continue;
            var note = noteGenerator.GenerateNote(e);
            SaveNote(note);
        }
    }
}
6.6.1
NoteGenerator
If a note is to be generated for an event, a concrete derivation of the abstract NoteGenerator class must be implemented. The
type parameter TCrmEvent corresponds to the event for which the note is generated. The concrete implementation must
overwrite the method GenerateNote, which receives the event as an input parameter and uses it to generate and return a Note
object.
Example
[NoteGenerator(typeof(ProjectCreatedEvent))]
public class ProjectCreatedNoteGenerator : NoteGenerator<ProjectCreatedEvent> 
{
    public override Note GenerateNote(ProjectCreatedEvent e)
    {
        var project = e.Project;
        var note = new ProjectCreatedNote
        {
            IsActive = true,
            ContactId = project.Id,
            Text = ProjectStatus.Open.Key
        };
        return note;
    }
}
6.7
PluginRenderActions
A plugin can inject its own PartialView into views of the main program or other plugins at predefined extension points. The
extension points are to be defined using the PluginRenderActions method, to which the name of the extension point is to be
passed as the first parameter.
Example of an extension point
   <% Html.PluginRenderActions("CompanySidebarExtensions"); %>
A method must be implemented within a controller class which returns the view to be injected and which must be marked with the
attribute [PluginRenderAction]. The attribute expects a comma-separated list of the names of the extension points at which the
view is to be injected as the only parameter.
Example
public class CompanyExtensionController : Controller
{
    [RenderAction("CompanySidebarExtensions", "CompanyMobileExtensions")]
    public virtual ActionResult CustomerCard(int id)
    {
        var model = new CrmModelItem<Company>
        {
            Item = companyService.GetCompany(id)
        };

DatabaseAttribute The DatabaseAttribute has two properties: ColumName and Ignore. Using ColumnName, the property
can be mapped to a DB column whose name is not identical to the property name.
example
[Database(Column = "CompanyKreditlimit")]
public string CreditLimit 
{
    get { return GetValue<string>("CreditLimit"); }
    set { SetValue("CreditLimit", value); }
}
If you set Ignore = true, the property for the mapping is completely ignored. This is necessary, for example, for lookup properties
(see below), which appear as a dropdown list on the UI, but should not be mapped to the DB, since only the lookup key is saved
for lookups.
example
public class CompanyExtension : EntityExtension<Company>
{
    [LookupKey]
    public string IndoorServiceKey 
    {
        get { return GetValue<string>("IndoorServiceKey"); }
        set { SetValue("IndoorServiceKey", value); }
    }
    [Database(Ignore = true)]
    public IndoorService IndoorService { 
    get 
    {
        return LookupManager.Instance.Get<IndoorService>(IndoorServiceKey);
    }
}
LookupKeyAttribute The LookupKeyAttribute identifies a lookup key. Properties with this attribute are not rendered on the
surface, but are filled via the drop-down list of the associated lookup property. According to the naming convention, the
name of the lookup key property must correspond to the name of the lookup property with the extension “Key” (see
example above).
LookupFilterAttribute This attribute can be used to filter the list of lookup values ​in the drop-down list. The attribute has
two properties:
MethodName NMethodName Name of a property of the type Func <bool, TLookup>, which must be implemented within the
EntityExtension class.
LookupType Type of the lookup property to be filtered.
Beispiel
public class CompanyExtension : EntityExtension<Company>
{
    [LookupKey]
    public string VisitFrequencyTimeUnitKey
    {
        get { return GetValue<string>("VisitFrequencyTimeUnitKey"); }
        set { SetValue("VisitFrequencyTimeUnitKey", value); }
    }
    [LookupFilter(MethodName = "OnlyTimeUnitsWithTimeUnitsPerYear",
    LookupType = typeof(TimeUnit))]
    [Database(Ignore = true)]
    public TimeUnit VisitFrequencyTimeUnit
    {
        get 
        {
            return LookupManager.Instance
                    .Get<TimeUnit>(VisitFrequencyTimeUnitKey);
        }
    }
    // Methods
    public bool OnlyTimeUnitsWithTimeUnitsPerYear(TimeUnit timeUnit)
    {
        return timeUnit.TimeUnitsPerYear.HasValue;

    }
}
ReadOnlyExtensionPropertyAttribute Properties with this attribute are mapped to the DB, but cannot be edited, ie no
input fields are rendered. The columns must be filled in some other way, e.g. by importing data. They are pure display
fields. For examples see View CustomerCard.ascx in the JaegerLacke plugin.
UIAttribute This attribute can be used to influence the display of the input field. The attribute has the following properties:
Caption Defines the resource key which is used for localizing the label of the input field, i.e. which is transferred to the
Html.Localize method. Without this specification, the property name is used as the resource key.
Row Extension Properties with the same Row value are rendered on one row.
ColumnsPerRow Specifies how many columns the row is divided into. This can be used to influence the size of the input fields
