6.9
Validation
Before an entity is stored in the database, it must be validated. There are two types of validation errors:
Attachment failure
Business Rules Violation

Editor mit Validierungsfehlern
A binding error occurs, for example, if an attempt is made to enter a string “abc” in the text field of a property of the type int. If an
entity is to be validated for binding errors, a ModelBinder must be implemented for this entity, which is derived from
CrmModelBinder:
[ModelBinderFor(typeof(Company))]
public class CompanyModelBinder : CrmModelBinder
{
    public override object BindModel(ControllerContext controllerContext,
            ModelBindingContext bindingContext)
    {
        var company = base.BindModel(controllerContext, bindingContext) as Company;
        return company;
    }
}
A format "hh [: mm]" is expected for properties of the TimeSpan or Nullable type (information in square brackets is optional). If the
permissible value is to be restricted to a range between 0 and 24 hours, the corresponding property must be provided with the
DayRestriction attribute:
public class Visit : EntityBase<int>
{
    public virtual int CompanyId { get; set; }
    public virtual string CompanyName { get; set; }
    public virtual DateTime Date { get; set; }
    [DayRestriction]
    public virtual TimeSpan? Time { get; set; }
}
Binding errors are added to the BindingRuleViolations collection of the EntityBase class.
For the review of the business rules, classes are to be introduced which are derived from the generic class Rule, where TEntity
indicates the entity to which the business rule relates. The Rule class defines three abstract or virtual (overwritable) methods:
public abstract class Rule<TEntity> : Rule
    where TEntity : class
{
    protected abstract RuleViolation CreateRuleViolation(TEntity entity);
    public abstract bool IsSatisfiedBy(TEntity entity);
    protected virtual bool IsIgnoredFor(TEntity entity)
    {
        return false;
    }
}
IsIgnoredFor defines whether this business rule should be ignored for the current entity. This is the case, for example, for notes
that are not assigned to any entity. In this case, it is not necessary to check for the existence of the ContactId:

public class ContactIdMustExist : Rule<Note>
{
    protected override bool IsIgnoredFor(Note note)
    {
        return note.ContactId == null;
    }
    …
}
IsSatisfiedBy implements the actual business logic and should return true if the current entity is valid, false otherwise:
public class ContactIdMustExist : Rule<Note>
{
    private readonly IContactService contactService;
    public override bool IsSatisfiedBy(Note note)
    {
        return contactService.DoesContactExist(note.ContactId.Value);
    }
}
The CreateRuleViolation method creates an object of the RuleViolation type if the business rule returns a validation error. An
overload of the RuleViolation method can be used to create this object:
public class ContactIdMustExist : Rule<Note>
{
    protected override RuleViolation CreateRuleViolation(Note note)
    {
        return RuleViolation(note, n => n.ContactId, "Contact");
    }
}
The error message can be controlled via the ErrorMessageKey or RuleClass properties of the RuleViolation class. If there is an
ErrorMessageKey, the resource file is searched for a key "RuleViolation.", Eg "RuleViolation.AccountInactive". If there is no
ErrorMessageKey, the RuleClass is used to generate the key, eg "RuleViolation.Required".
The RuleClass is passed to the constructor of the Rule base class. This is a value of the RuleClass enumeration:
public class ContactIdMustExist : Rule<Note>
{
    public ContactIdMustExist(IContactService contactService)
    : base(RuleClass.MustExist)
    {
        this.contactService = contactService;
    }
}
For frequently used business rules, there are already some base classes that make implementation easier. These can be found
in the namespace CrmLibrary.Validation.BaseRules of CrmLibrary.dll.
Example:
public class TextRequired : RequiredRule<Note>
{
    public TextRequired()
    {
        Init(n => n.Text);
    }
}
6.10
Client-side validation
By default, the complete validation takes place on the server side, ie the user entries are sent to the server, where the validation
rules are checked and if a rule is violated, an HTML page with the error messages is rendered and sent back to the client. To
save yourself this server round trip, there is the option of activating a client-side validation based on the jquery.validate.js plug-in
using the HtmlHelper extension method ClientSideValidation.
Note: Client-side validation has so far only been implemented for certain, frequently occurring rules (e.g. RequiredRule,
MaxLengthRule, etc.). In addition, a round trip to the server is always necessary for certain rules, for example to check the
uniqueness of a name in the database.
The ClientSideValidation method has several overloads.

string ClientSideValidation<TEntity>(this IHtmlHelper htmlHelper)
string ClientSideValidation<TEntity>(this IHtmlHelper htmlHelper,
                                        string formSelector)
In the first variant, the HTML page is searched for a FORM tag whose fields are validated. The second overload enables a
restriction to a specific form with the help of a jQuery selector:
<%= Html.ClientSideValidation<Person>(".person-edit") %>
A JavaScript tag is rendered into the page for client-side validation. There is a template Content / js / templates / validation.js for
this. Valid JavaScript is generated from this using the following code within the ClientSideValidation method:
var sb = new StringBuilder();
sb.AppendLine("<script type=\"text/javascript\">");
sb.Append(TemplateProvider.GetTemplate("Content/js/templates/validation.js"));
sb.AppendLine("</script>");
sb.Replace("[[form_selector]]", formSelector);
sb.Replace("[[rules_as_json]]", rulesAsJson.ToString(","));
sb.Replace("[[messages_as_json]]", messagesAsJson.ToString(","));
return sb.ToString();
RulesAsJson and messagesAsJson are Json objects that describe the rules and associated error messages. These are required
by the jquery.validate plugin.
6.11
Overriding business rules
A plugin can override a business rule for an entity. The override is based on the entity type, class name and priority. The default
priority is 0.
Example:
The main program defines a business rule for the Name property of the project entity:
public class NameMaxLength : MaxLengthRule<Project>
{
    public NameMaxLength()
    {
        Init(c => c.Name, 120);
    }
}
A plugin can override this rule with the following class:
public class NameMaxLength : MaxLengthRule<Project>
{
    public override int Priority
    {
        get { return 10; }
    }
    public NameMaxLength()
    {
        Init(c => c.Name, 20);
    }
}
6.12
Background agents
Background agents are background processes that run at regular time intervals. They must derive from the base class
BackgroundServiceBase and implement the abstract method Run and be provided with the attribute [BackgroundService]. The
Run method contains the logic of the background agent and is called periodically. The standard time interval is 5 minutes. If a
different time interval is to be specified, this must be defined in the OnInitializeSettings method. Additional configuration data can
also be specified here, which are required by the background agent. These specifications are written into the DB table
BackgroundServiceSetting during the first execution and can be changed later on the admin page of the Crm application.
Example
[BackgroundService]
public class MessageSender : BackgroundServiceBase

{
    protected override void Run()
    {
        SendMessages();
    }
    protected override void OnInitializeSettings()
    {
        SetSetting("Interval", TimeSpan.FromSeconds(61).TotalSeconds.ToString());
        SetSetting("Host", "127.0.0.1");
        SetSetting("Port", "25");
    }
    …
}
Note: If the Run method is to be debugged when the application is started, the RunOnFirstStartUp property must be set to true in
the constructor. In this case, the Run method is executed synchronously when the program is started (ie not as a background
thread).
6.13
FAQ
How is a plugin activated / deactivated? Via the site settings or site settings, plugins can be activated and deactivated under
the Properties or Properties tab.
Where are the activated plugins stored in the database? In the table Crm.Site. The ActivePlugins column contains the names
of the active plugins in the form of a comma-separated list.
How are the DB structures required by a plugin created? When a plugin is activated for the first time, all create scripts in the
Database / Create subdirectory of the plugin are executed. The scripts are executed in the lexical order of their filename. A
SchemaInfo table for the plugin is also created in which the migrations are saved. After running the create scripts, the migrations
are carried out in the Database / Migrate folder and their migration number is saved in the SchemaInfo table. Each time the plug-
in is activated again, only those migrations are carried out whose migration number is not in the SchemaInfo table. In other
words, if you have written a new migration and want to use it, the plug-in must be deactivated and then reactivated in order to
execute the migration.
Note The check whether the plug-in is being activated for the first time is carried out using the plug-in's SchemaInfo table. The
create scripts are only executed if this table does not exist.
How are Selenium tests for plugins written? In order to be able to test a plugin, the plugin must be activated. The
IsPluginActive, ActivatePlugin and DeactivatePlugin methods are available in the SeleniumTest class for this purpose. The setup
method should check whether the plug-in to be tested is active. If not, it should be activated by calling ActivatePlugin.
Example:
[TestFixture]
public class ExpenseTests : SeleniumTest
{
    [SetUp]
    public void SetUp()
    {
        if (!IsPluginActive("Crm.Service"))
        {
            ActivatePlugin("Crm.Service");
        }
        GoToUrl("/Crm.Service/Expense", DefaultUserToken);
        …
    }
}
How is a new note type defined in a plugin? Note types must derive from the base class Note and override the
IsSystemGenerated property. For notes generated by the system (e.g. when completing a task) this property should return the
value true, otherwise false. System-generated notes are marked by a rectangle with rounded corners and an identifier text (eg
"Task" or "Task"). The color of the rectangle and the text are set using the ImageColor and ImageTextKey properties. For non-
system-generated notes, a url for an image must be specified using the ImageVortualUrl property
Example
public class OrderStatusChangedNote : Note
{
    public override bool IsSystemGenerated { get { return true; } }

    public override string ImageTextKey { get { return "Status"; } }
}
A subclass mapping for the new note type must be specified as the NHibernate mapping. The different note types are
differentiated using the DiscrimatorValue.
public class OrderStatusChangedNoteMap : SubclassMapping<OrderStatusChangedNote>
{
    public OrderStatusChangedNoteMap()
    {
        DiscriminatorValue("OrderStatusChanged");
    }
}
How can a lookup be extended by a plugin? If a lookup is to be expandable by plugins and the lookup values ​are to be
accessed in the code (i.e. the lookup values ​are known at development time and are not created by the user via the user
interface), the value of a lookup object can be checked using static methods.
Example
[Lookup("[SMS].[ServiceOrderDispatchStatus]")]
public class ServiceOrderDispatchStatus : Lookup<string>
{}
// Extension methods
public static class ServiceOrderDispatchStatusExtensions
{
    public static bool IsScheduled(this ServiceOrderDispatchStatus status)
    {
        return status.Key == "Scheduled";
    }
    public static bool IsReleased(this ServiceOrderDispatchStatus status)
    {
        return status.Key == "Released";
    }
}
The lookup values ​"Scheduled" and "Released" are known at development time. If a plugin introduces a new value, a new
extension method can be implemented in the plugin:
public static class PluginServiceOrderDispatchStatusExtensions
{
    public static bool IsInSomeNewStatus(this ServiceOrderDispatchStatus status)
    {
        return status.Key == "IsInSomeNewStatus";
    }
}
The advantage of this procedure compared to the definition of static properties in the main program is that lookup values ​defined
in the plugin can be addressed with the same syntax as the lookup values ​defined in the main program. If the lookup values ​of
the main program are defined with the help of static properties, this would not be possible because the lookup class cannot be
extended.

