13.5
Menu extensions~~~~
You're able to extend and modify the existing main menus of the application. By registering new menu entries to the left, right or
mobile menu you're able to extend the application with custom implementations. To change the default menu structure you have
to create a custom MenuRegistrar class. To extend certain parts of the menu you may choose to inherit the following interfaces:
IMenuRegistrar for the menu in the material client
IMenuRegistrar for the collapsible menu in the material client ~~~~ ```c# namespace Customer.ACME { using Crm; using
Crm.Library.Modularization.Menu;
public class ACMEMenuRegistrar : IMenuRegistrar, IMenuRegistrar { public virtual void Initialize(MenuProvider
menuProvider) { // operations on menu for material client } public virtual void Initialize(MenuProvider menuProvider) { //
operations on collapsible menu for material client } } } ```
